import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import Paper from "@material-ui/core/Paper";

function Leistung1() {
  return (
    <div>
      <Header />
      <Paper elevation={3} />
      <Footer />
    </div>
  );
}

export default Leistung1;
